function onYouTubeIframeAPIReady(){if("undefined"!=typeof playerInfoList)for(var t=0;t<playerInfoList.length;t++){createPlayer(playerInfoList[t])}}function createPlayer(t){return new YT.Player("player-"+t.videoId,{height:t.height,width:t.width,videoId:t.videoId})}var tag=document.createElement("script");tag.src="https://www.youtube.com/iframe_api";var firstScriptTag=document.getElementsByTagName("script")[0];firstScriptTag.parentNode.insertBefore(tag,firstScriptTag);var playerInfoList=[];$(document).ready(function(){$('[id^="player-"]').each(function(){{var t=$(this).data("height")?$(this).data("height"):390;$(this).data("width")?$(this).data("width"):640}playerInfoList.push({id:$(this).attr("id"),height:t,width:$(this).data("width"),videoId:$(this).attr("id").replace("player-","")})})});